import React from 'react';


class ClassComponent extends React.Component {
    constructor() {
        super();
        this.state = {
            course: "React Native",
        }
    }

    render() {
        return(
            <div>
                <CourseComponent course={this.state.course} />
            </div>
        )
    }
}

class CourseComponent extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            course: 'Flutter'
        }
    }

    render() {
        return (
            <>
                <h1>My favourite course is {this.state.course} !</h1>
            </>
        )
    }
}

export default ClassComponent;
